// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

contract DecentralizedDataMarketplace {
    struct DataPool {
        address data_pool_owner;
        string data_pool_id;
        uint256 max_incentive;
        uint256 num_uploads;
        bool availableForPurchase;
        uint256 price_per_upload;
    }

    mapping(string => DataPool) public dataPools;
    bytes32 public DataUploadmerkleRoot;
    address public owner;
    IERC20 public cgdxToken;

    event DataSetPurchased(
        address indexed buyer,
        string dataPoolId,
        uint256 price
    );
    event DataUploadCompleted(string dataPoolId, uint256 numUploads);
    event LogMerkleRootUpdated(bytes32 newRoot);
    event LogTokenTransfer(address indexed userAddress, uint256 tokenReward);
    event LogApproval(address indexed owner, address spender, uint256 value);
    event DataUploadsPurchased(
        bytes32[] uploadHashes,
        uint256 dataQuality,
        string dataPoolId,
        address userAddress
    );

    constructor(bytes32 _merkleRoot, address _cgdxTokenAddress) {
        owner = msg.sender;
        DataUploadmerkleRoot = _merkleRoot;
        cgdxToken = IERC20(_cgdxTokenAddress);
    }

    modifier onlyOwner() {
        require(msg.sender == owner, "Not the contract owner");
        _;
    }

    function getAllowance(address spender) public view returns (uint256) {
        return cgdxToken.allowance(owner, spender);
    }

    function updateDataUploadMerkleRoot(bytes32 newRoot) public onlyOwner {
        DataUploadmerkleRoot = newRoot;
        emit LogMerkleRootUpdated(newRoot);
    }

    function getDataUploadMerkleRoot() external view returns (bytes32) {
        return DataUploadmerkleRoot;
    }

    function uploadIncentive(
        bytes32 uploadHash,
        bytes32[] calldata proof,
        uint256 dataQuality,
        uint256 index,
        string calldata dataPoolId,
        bytes32 newMerkleRoot,
        address userAddress
    ) external onlyOwner {
        require(
            verifyMerkleProof(DataUploadmerkleRoot, proof, uploadHash, index),
            "Invalid Merkle proof"
        );
        require(dataQuality > 0 && dataQuality <= 10, "Invalid data quality");

        DataPool storage pool = dataPools[dataPoolId];
        require(pool.max_incentive > 0, "Invalid data pool");

        uint256 reward = (dataQuality * pool.max_incentive) / 10;
        pool.num_uploads++;

        DataUploadmerkleRoot = newMerkleRoot;
        uint256 tokenReward = reward * 10 ** 18;

        // Handle the transfer result properly
        bool success = cgdxToken.transferFrom(owner, userAddress, tokenReward);
        require(success, "Token transfer failed");

        emit DataUploadCompleted(dataPoolId, pool.num_uploads);
        emit LogTokenTransfer(userAddress, tokenReward);
    }

    function purchaseUploads(
        string memory dataPoolId,
        bytes32[] calldata uploadHashes,
        uint256[] calldata dataQualities
    ) external {
        DataPool storage pool = dataPools[dataPoolId];
        require(pool.availableForPurchase, "Dataset not for sale");

        uint256 total_quality = 0;
        uint256 total_price_of_data = 0;
        uint256 scale = 10 ** 18; // Define scale factor for fixed-point arithmetic

        // Calculate total data quality
        for (uint256 i = 0; i < uploadHashes.length; i++) {
            require(
                dataQualities[i] > 0 && dataQualities[i] <= 10,
                "Invalid data quality"
            );

            total_quality += dataQualities[i];
        }

        // Calculate average data quality, scaled to avoid precision loss
        // We multiply by `scale` first before dividing to avoid float truncation
        uint256 average_quality = (total_quality * scale) /
            (dataQualities.length * 10);

        // Calculate total price based on average data quality and price per upload
        total_price_of_data =
            average_quality *
            pool.price_per_upload *
            uploadHashes.length;

        // Check CGDX token balance
        require(
            cgdxToken.balanceOf(msg.sender) >= total_price_of_data,
            "Insufficient CGDX balance"
        );

        // Transfer CGDX tokens to the owner
        require(
            cgdxToken.transferFrom(
                msg.sender,
                pool.data_pool_owner,
                total_price_of_data
            ),
            "Token transfer failed"
        );

        // Emit event for data uploads purchase
        emit DataUploadsPurchased(
            uploadHashes,
            average_quality,
            dataPoolId,
            msg.sender
        );
    }

    function verifyMerkleProof(
        bytes32 _root,
        bytes32[] memory _proof,
        bytes32 _leaf,
        uint256 index
    ) public pure returns (bool) {
        bytes32 computedHash = _leaf;

        for (uint256 i = 0; i < _proof.length; i++) {
            bytes32 proofElement = _proof[i];

            if (index % 2 == 0) {
                computedHash = keccak256(
                    abi.encodePacked(computedHash, proofElement)
                );
            } else {
                computedHash = keccak256(
                    abi.encodePacked(proofElement, computedHash)
                );
            }

            index /= 2;
        }

        return computedHash == _root;
    }

    function addDataPool(
        string memory poolId,
        uint256 maxIncentive,
        uint256 price_per_upload,
        bool availableForPurchase,
        address dataPoolOwner
    ) external onlyOwner {
        dataPools[poolId] = DataPool(
            dataPoolOwner,
            poolId,
            maxIncentive,
            0,
            availableForPurchase,
            price_per_upload
        );
    }

    function getDataPool(
        string memory poolId
    ) external view returns (DataPool memory) {
        return dataPools[poolId];
    }
}
